export default function CarDetail({ car }) {

  // const classes = useStyle();



  // console.log('cardetail page');
  // console.log(car);
   const history = useHistory();
  const handleClick = async({ca}) =>{
    console.log("handle click " + car._id);
    history.push("/cardetails/"+car._id);
  }

  return (
    <Card container style={{ color: 'red', backgroundColor: '#f1f1f1' }} >
      <CardActionArea  onClick={() => { handleClick(car._id);}}>
        <CardMedia
          component="img"
          height="240"
          image={car.carImages}
          alt="Car img"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            {car.model}
          </Typography>
          <Typography variant="body2" color="text.secondary">
            <b> Brand Name :</b> {car.brand}
          </Typography>
          <Typography variant="body2" color="text.secondary">
            <b> Model Name :</b> {car.model}
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
